const ListStoreItems = (props) => {

    return (
                    <table border="1" style={{margin:20}}>
                <thead>
                    <th>#</th>
                    <th>Time</th>
                    <th>Product Name</th>
                    <th>Product Price</th>
                    <th>Delete</th>
                    <th>Edit</th>

                </thead>

                {props.products.map(p => {
                    return (
                        <tr>
                        <td>1</td>
                        <td>{p.time}</td>
                        <td>{p.productName}</td>
                        <td>{p.productPrice}</td>
                        <td>
                            <button>Delete</button>
                        </td>

                        <td>
                            <button>Edit</button>
                        </td>
                    </tr>
                    )
                })

                }

            </table>
    )
}

export default ListStoreItems;
